div.div:
                                        It depends on if you want to store each Gross Pay individually, and sum them afterwards, so that you could reuse them later; or you simply want the total of them.

If you want to store each value individually, and sum them later, you could first declare a
                                        std::vector
                                        .
```
std::vector grossPays;

while (hours >0)
{
    //after you got gross already
    grossPays.push_back(gross);
}
                                        - If you simply want to get the total of all gross, you could:
                                        double totalGross = 0.0;
while (hours >0)
{
    //after you got gross already
    totalGross += gross;
}
                                        <br />

(5 more lines were trimmed)
                                        double grossPay(int h, double p)
{
    double r;
    if(h>40) r = hp1.5;
    else r = h*p;
    return r;
}
                                        Your `main` would be
                                        gross =  grossPay(hours, payRate);
                                        Or you can pass in `gross` by reference:
                                        void grossPay(int h, double p, int& r)
{
    if(h>40) r = hp1.5;
    else r = h*p;
}
                                        and your `main` would be
                                        grossPay(hours, payRate, gross);
```
